import { Component, OnInit } from '@angular/core';
import { DataServiceService } from '../data-service.service';


@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {

constructor(private service: DataServiceService, ) { }

  ngOnInit(): void {}

  orgName string : any;



  onSubmit() {



    // this.http.post('https://your-backend-url.com/api/signup', formData)
    //   .subscribe((response: any) => {
    //     console.log('Form submitted successfully', response);
    //   }, (error: any) => {
    //     console.error('Error submitting form', error);
    //   });

  }


}
<div class="container mt-5 mb-5">
  <div class="card shadow-lg p-4">
    <h2 class="text-center mb-4">Organization Signup</h2>

      <!-- Organization Name -->
      <div class="mb-3">
        <label for="orgName" class="form-label">Organization Name</label>
        <input type="text" value="orgName" class="form-control" placeholder="Enter organization name">
      </div>

      <!-- Contact and Email -->
      <div class="row">
        <div class="col-md-6 mb-3">
          <label for="contact" class="form-label">Contact</label>
          <input type="tel" value="contact" class="form-control" placeholder="Enter contact number">
        </div>
        <div class="col-md-6 mb-3">
          <label for="email" class="form-label">Email</label>
          <input type="email" value="email" class="form-control" placeholder="Enter email address">
        </div>
      </div>

      <!-- Street Address -->
      <div class="mb-3">
        <label for="streetAddress" class="form-label">Street Address</label>
        <input type="text" value="streetAddress" class="form-control" placeholder="Enter street address">
      </div>

      <!-- City and District -->
      <div class="row">
        <div class="col-md-6 mb-3">
          <label for="city" class="form-label">City</label>
          <input type="text" value="city" class="form-control" placeholder="Enter city">
        </div>
        <div class="col-md-6 mb-3">
          <label for="district" class="form-label">District</label>
          <input type="text" value="district" class="form-control" placeholder="Enter district">
        </div>
      </div>

      <!-- Block, Zip Code, and State -->
      <div class="row">
        <div class="col-md-4 mb-3">
          <label for="block" class="form-label">Block</label>
          <input type="text" value="block" class="form-control" placeholder="Enter block">
        </div>
        <div class="col-md-4 mb-3">
          <label for="zipCode" class="form-label">Zip Code</label>
          <input type="text" value="zipCode" class="form-control" placeholder="Enter zip code">
        </div>
        <div class="col-md-4 mb-3">
          <label for="state" class="form-label">State</label>
          <input type="text" value="state" class="form-control" placeholder="Enter state">
        </div>
      </div>

      <!-- Submit Button -->
      <div class="text-center mt-4">
        <button type="submit" class="btn btn-primary btn-lg" (click)="onSubmit()">Sign Up</button>
      </div>
  </div>
</div>
